// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home/Home';
import CasualPage from './components/Casual/CasualPage';
import Portfolio from './components/Portfolio/Portfolio';
import ResumeAndCertificates from './components/ResumeAndCertificates/ResumeAndCertificates';
import AboutMe from './components/AboutMe/AboutMe';
import Contact from './components/Contact/Contact';
import Services from './components/Services/Services';
import Skills from './components/Skills/Skills';
import ProfessionalPage from './components/Professional/ProfessionalPage';
import LayoutWithNavbar from './components/LayoutWithNavbar';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <LayoutWithNavbar navbar={<NavbarCasual />} isProfessional={false}>
              <Home />
            </LayoutWithNavbar>
          }
        />
        {/* Casual routes */}
        <Route
          path="/casual/*"
          element={
            <LayoutWithNavbar navbar={<NavbarCasual />} isProfessional={false}>
              <CasualPage />
            </LayoutWithNavbar>
          }
        />
        <Route
          path="/casual/ResumeAndCertificates/*"
          element={<ResumeAndCertificates />}
        />
        <Route path="/casual/Portfolio/*" element={<Portfolio />} />
        <Route path="/casual/AboutMe/*" element={<AboutMe />} />
        <Route path="/casual/Contact/*" element={<Contact />} />

        {/* Professional routes */}
        <Route
          path="/professional/*"
          element={
            <LayoutWithNavbar
              navbar={<NavbarProfessional />}
              isProfessional={true}
            >
              <ProfessionalPage />
            </LayoutWithNavbar>
          }
        />
        <Route path="/professional/Portfolio/*" element={<Portfolio />} />
        <Route path="/professional/Services/*" element={<Services />} />
        <Route path="/professional/Skills/*" element={<Skills />} />
        <Route path="/professional/Contact/*" element={<Contact />} />
      </Routes>
    </Router>
  );
};

export default App;
